<span class="line"><span style="color:#C792EA;">let</span><span style="color:#A6ACCD;"> it </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#82AAFF;">myIterator</span><span style="color:#A6ACCD;">(arr)</span></span>
